function update()
{
	
	switch(this.id)
	{
		case "developmentRegion":
		removeOptions("Zones")
		removeOptions("District")
		removeOptions("Municipalities")
		var current_selection =  document.getElementById("Zones")
		var select_development_region = document.getElementById("developmentRegion").value
		names = Object.keys(data[select_development_region])
		break;

		case "Zones":
		removeOptions("District")
		removeOptions("Municipalities")
		var current_selection =  document.getElementById("District")
		var select_development_region = document.getElementById("developmentRegion").value
		var selected_zone = document.getElementById("Zones").value
		names = Object.keys(data[select_development_region][selected_zone])
		break;

		case "District":
		removeOptions("Municipalities")
		var current_selection =  document.getElementById("Municipalities")
		var select_development_region = document.getElementById("developmentRegion").value
		var selected_zone = document.getElementById("Zones").value
		var selected_district = document.getElementById("District").value
		var names = data[select_development_region][selected_zone][selected_district]	
		break;
		
		
	}
	for (var keys in names)
	{

		option = createOption(names[keys],names[keys])
		current_selection.appendChild(option)
	}
}


function removeOptions(select)
{
	selectbox = document.getElementById(select)
	selectbox.options.length = 0
	option = createOption(0,select)
	selectbox.appendChild(option)
}

function createOption(id, content)
{
	var option = document.createElement("option");
	option.value = id
	option.innerHTML = content

	return option
}

window.onload = function () {
	var select_development_regions =  document.getElementById("developmentRegion")
	dev_regions = Object.keys(data)
	for (var keys in dev_regions)
		{	option = createOption(dev_regions[keys],dev_regions[keys])
			select_development_regions.appendChild(option)
		}
		
	}
	document.getElementById('developmentRegion').addEventListener('change',update,false);
	document.getElementById('Zones').addEventListener('change',update,false);
	document.getElementById('District').addEventListener('change',update,false);


